import React, { Component } from 'react'
import props from 'prop-types';
import { BrowserRouter, Route,NavLink, Switch } from 'react-router-dom';


class NavigationComponent extends React.Component{
    constructor(props){
        super(props);
        this.state={
            clicked:"doctors",
        }
        this.handleDoctorClick.bind(this);
        this.handleLoginClick.bind(this);
    }

    handleDoctorClick(){
        console.log("doctors");
        this.setState((state,props)=>({
            clicked:"doctors"

        }));
    }
    handleLoginClick(){
        this.setState((state,props)=>({
            clicked:"login"
        }));
    }
    render(){
        return(
        <nav class="navbar navbar-expand-lg bg-secondary text-uppercase fixed-top" id="mainNav">
            <div class="container">
                <a class="navbar-brand js-scroll-trigger" href="#page-top">Przychodnia XYZ</a>
                <button class="navbar-toggler navbar-toggler-right text-uppercase font-weight-bold bg-primary text-white rounded" type="button" data-toggle="collapse" data-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
                    Menu
                    <i class="fas fa-bars"></i>
                </button>
                <div class="collapse navbar-collapse" id="navbarResponsive">
                    <ul class="navbar-nav ml-auto">
                        <li class="nav-item mx-0 mx-lg-1"><a class="nav-link py-3 px-0 px-lg-3 rounded js-scroll-trigger" href="#" id="doktorzy" onClick={()=>this.handleDoctorClick()} ><NavLink to='/doctors'>Doktorzy</NavLink></a></li>
                        <li class="nav-item mx-0 mx-lg-1"><a class="nav-link py-3 px-0 px-lg-3 rounded js-scroll-trigger" href="#about" id="logowanie" onClick={()=>this.handleLoginClick()}>Logowanie</a></li>
                        <li class="nav-item mx-0 mx-lg-1"><a class="nav-link py-3 px-0 px-lg-3 rounded js-scroll-trigger" href="#contact">Kontakt</a></li>
                    </ul>
                </div>
            </div>
        </nav>
        )
        }



}
export default NavigationComponent;
